import React from "react";
import styled from "styled-components";
const Wrapper = styled.section`
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
  z-index: 500;
  & > .back {
    width: 100%;
    height: 100%;
    position: absolute;
    left: 0;
    top: 0;
    background-color: black;
    opacity: 0.5;
  }
  & > .box {
    position: relative;
    z-index: 2000;
    width: 341px;
    height: 421px;
    border-radius: 20px;
    background-color: white;
  }
`;
function Popup() {
  return (
    <Wrapper>
      <div className="back" />
      <div className="box">
        <figure className="profile">
          <img src="/assets/kimface.svg" alt="" />
        </figure>
      </div>
    </Wrapper>
  );
}

export default Popup;
